import React from 'react';

const List = ({people}) => {
  return (
    <>
      {people.map((people)=>{
        const {id, name, age, image} = person;
        return <article key={id} className="person">
          <img src={image} alt={name}/>
          <div>

          </div>
        </article>
      })}
    </>
  );
};

export default List;
